import React from 'react'

function Begin() {
    const ran = Math.floor(Math.random() * 10);
    const shuffle = [
        "green",
        "orange",
        "green",
        "orange",
        "green",
        "orange",
        "green",
        "orange",
        "green",
        "orange"
    ]
  return (
    <h1>{shuffle()}</h1>
  )
}

export default Begin
